expected_keys = {'1. open', '2. high', '3. low', '4. close', '5. volume'}
def get_stock_data_from_dict(data):
    filtered_data = {}

    # Filtrer les donnes pour ne garder que celles avec les cls attendues
    for date, values in data.items():
        # Normaliser les cls
        normalized_values = {k.strip(): v for k, v in values.items()}

        # Vrifier si les cls de l'entre correspondent aux cls attendues
        if set(normalized_values.keys()) == expected_keys and all(v for v in normalized_values.values()):
            filtered_data[date] = normalized_values
        else:
            print(f"Entre ignore pour la date {date}: {normalized_values}")

    # Crer un DataFrame  partir des donnes filtres
    df = pd.DataFrame.from_dict(filtered_data, orient='index')
    
    # Renommer les colonnes
    df.columns = ['open', 'high', 'low', 'close', 'volume']

    # Convertir l'index en format date et les colonnes en type float
    df.index = pd.to_datetime(df.index)
    df = df.astype(float)
    df = df.sort_index()

    return df

def calculate_sma(prices, period):
    return prices.rolling(window=period).mean()

def calculate_rsi(prices, period=14):
    delta = prices.diff()  # Calcul des changements de prix d'un jour  l'autre
    gain = delta.where(delta > 0, 0)  # Gains seulement (remplacer les pertes par 0)
    loss = -delta.where(delta < 0, 0)  # Pertes seulement (remplacer les gains par 0)

    # Moyenne exponentielle des gains et des pertes
    avg_gain = gain.rolling(window=period).mean()
    avg_loss = loss.rolling(window=period).mean()

    # Calcul du RS (Relative Strength)
    rs = avg_gain / avg_loss

    # Calcul du RSI
    rsi = 100 - (100 / (1 + rs))

    return rsi

def calculate_ema(prices, period):
    return prices.ewm(span=period, adjust=False).mean()


def calculate_macd(prices):
    ema_12 = calculate_ema(prices, 12)
    ema_26=calculate_ema(prices, 26)
    macd = ema_12 - ema_26  # Ligne MACD
    signal = calculate_ema(macd, 9)  # Ligne de signal
    return macd, signal

def generate_signals(df):
    buy_signals = []
    sell_signals = []

    for i in range(1, len(df)):
        # Rgle d'achat
        if df['RSI_14'].iloc[i] < 30 and df['MACD'].iloc[i] > df['MACD_Signal'].iloc[i]:
            buy_signals.append(df.index[i])
        
        # Rgle de vente
        if df['RSI_14'].iloc[i] > 70 and df['MACD'].iloc[i] < df['MACD_Signal'].iloc[i]:
            sell_signals.append(df.index[i])
    
    return buy_signals, sell_signals



